<template>
    <div id="app">
        <v-app id="inspire">
            <v-stepper v-model="e6" vertical>
                <v-stepper-step :complete="e6 > 1" step="1">
                    Layanan
                    <small>Layanan Yang Sudah Di Konfirmasi</small>
                </v-stepper-step>

                <v-stepper-content step="1">
                    
                    <v-card>
                        <v-container grid-list-md mb-0>
                            <h2 class="text-md-center">Data Layanan</h2> 
                            <v-layout row wrap style="margin:10px"> 
                                <v-flex xs6 class="text-right"> 
                                    <v-text-field 
                                        v-model="keyword"
                                        append-icon="mdi-search"
                                        label="Pencarian" 
                                        hide-details 
                                    ></v-text-field>
                                </v-flex> 
                            </v-layout> 
                            <v-data-table 
                                :headers="headers" 
                                :items="services" 
                                :search="keyword" 
                                :loading="load" 
                            > 
                                <template v-slot:body="{ items }"> 
                                    <tbody> 
                                        <tr v-for="(item,index) in items" :key="index"> 
                                            <td>{{ index + 1 }}</td>
                                            <td>{{ item.id }}</td>
                                            <td>{{ item.customer.name }}</td>  
                                            <td>{{ item.pet.name}}</td>
                                            <td> 
                                                <v-btn 
                                                    icon 
                                                    color="indigo" 
                                                    light
                                                    @click="editHandle(item)"
                                                > 
                                                <v-icon>mdi-plus</v-icon>
                                                </v-btn>
                                                <v-btn
                                                    icon
                                                    color="error"
                                                    light
                                                    @click="deleteServiceDetail(item.id)"
                                                > 
                                                    <v-icon>mdi-delete</v-icon>
                                                </v-btn>
                                            </td> 
                                        </tr> 
                                    </tbody> 
                                </template> 
                            </v-data-table>
                        </v-container> 
                    </v-card>

                     <v-snackbar 
                        v-model="snackbar"
                        :color="color" 
                        :multi-line="true" 
                        :timeout="3000"
                    > 
                        {{ text }} 
                        <v-btn 
                            dark 
                            text 
                            @click="snackbar = false" 
                        > 
                            Close 
                        </v-btn> 
                    </v-snackbar>

                    <v-btn color="primary" @click="setTabel()">Continue</v-btn>
                </v-stepper-content>

                <v-stepper-step :complete="e6 > 2" step="2">Konfirmasi</v-stepper-step>

                <v-stepper-content step="2">
                    
                    <v-card>
                        <v-container grid-list-md mb-0>
                            <h2 class="text-md-center">Data Layanan</h2> 
                            <v-layout row wrap style="margin:10px"> 
                                <v-flex xs6 class="text-right"> 
                                    <v-text-field 
                                        v-model="searchTabel"
                                        append-icon="mdi-search"
                                        label="Pencarian" 
                                        hide-details 
                                    ></v-text-field>
                                </v-flex> 
                            </v-layout> 
                            <v-data-table 
                                :headers="headersTabel" 
                                :items="detailServices" 
                                :search="searchTabel" 
                                :loading="loadTabel" 
                            > 
                                <template v-slot:body="{ items }"> 
                                    <tbody> 
                                        <tr v-for="(item,index) in items" :key="index"> 
                                            <td>{{ index + 1 }}</td>
                                            <td>{{ item.service.complete_name }}</td>
                                            <td>{{ item.service.price}}</td>
                                            <td> 
                                                <v-btn
                                                    icon
                                                    color="error"
                                                    light
                                                    @click="deleteTabel(item,index)"
                                                > 
                                                    <v-icon>mdi-delete</v-icon>
                                                </v-btn>
                                            </td> 
                                        </tr> 
                                    </tbody> 
                                </template> 
                            </v-data-table>
                        </v-container> 
                    </v-card>

                    <v-container> 
                        <v-row>
                            <v-col cols="5"> 
                                Total Biaya : {{total}}
                            </v-col>
                        </v-row>
                        <v-row>
                            <v-col cols="5"> 
                                Diskon : 
                                <v-text-field v-model="formBayar.diskon"></v-text-field>
                            </v-col>
                        </v-row>
                        <v-row>
                            <v-col cols="5"> 
                                Pembayaran : 
                                <v-text-field v-model="formBayar.pembayaran"></v-text-field>
                            </v-col>
                        </v-row>
                        <v-row>
                            <v-col cols="5"> 
                                Kembalian : {{kembalian}}
                            </v-col>
                            <v-col cols="5"> 
                                 <v-btn color="blue darken-1" text @click="setHitung()">Hitung</v-btn>
                            </v-col>
                        </v-row>
                    </v-container>

                     <v-snackbar 
                        v-model="snackbar"
                        :color="color" 
                        :multi-line="true" 
                        :timeout="3000"
                    > 
                        {{ text }} 
                        <v-btn 
                            dark 
                            text 
                            @click="snackbar = false" 
                        > 
                            Close 
                        </v-btn> 
                    </v-snackbar>

                    <v-btn color="primary" v-if="clear === true" @click="setConfirm()">Continue</v-btn>
                    <v-btn text  @click="backService()">Cancel</v-btn>
                </v-stepper-content>

            </v-stepper>
        </v-app>
    </div>
</template>
<script>
import jspdf from 'jspdf'
import 'jspdf-autotable'
    export default {
        data() {
            return {
                e6: 1,
                e1: 1,
                snackbar : false,
                color : null,
                text : '',
                inputType: '',
                clear: false,
                a: 0,

                // service
                services: [],
                detailServices: [],
                keyword: '',
                load: '',
                headers: [
                    { 
                        text: 'No', 
                        value: 'no', 
                    }, 
                    { 
                        text: 'Id Layanan', 
                        value: 'id' 
                    },
                    { 
                        text: 'Nama Customer', 
                        value: 'customer.name' 
                    }, 
                    { 
                        text: 'Nama Hewan Peliharaan', 
                        value: 'pet.name' 
                    }, 
                    { 
                        text: 'Aksi', 
                        value: null 
                    }, 
                ],
                formService : {
                    id : '',
                    nama : '',
                    namaPet : '',
                    jenisPet : '',
                    telepon : '',
                    cs : '',
                },

                // Tabel Penampung
                searchTabel: '',
                loadTabel: '',
                headersTabel:[
                    { 
                        text: 'No', 
                        value: 'no', 
                    }, 
                    { 
                        text: 'Nama Layanan', 
                        value: 'nama_service' 
                    },
                    { 
                        text: 'Harga Layanan', 
                        value: 'price' 
                    },
                    { 
                        text: 'Aksi', 
                        value: null 
                    }, 
                ],
                total: 0,
                kembalian: 0,
                formBayar: {
                    diskon : 0,
                    pembayaran : 0,
                }

            }
        },
        methods: {
            getDataLayanan(){
                var uri = this.$apiUrl + 'servicetransaction/kasir/getall' 
                this.$http.get(uri).then(response =>{ 
                    this.services = response.data.data
                })
            },
            setTotal(){
                let temp = 0;
                this.detailServices.forEach(element => {
                    temp = parseInt(temp) + parseInt(element.service.price)
                });
                this.total = temp
            },
            setHitung(){

                let pemdis = (parseInt(this.formBayar.pembayaran) + parseInt(this.formBayar.diskon))

                if(parseInt(pemdis) < parseInt(this.total)){
                    this.snackbar = true;
                    this.color = 'red';
                    this.text = 'Jumlah Uang Kurang';
                }else{
                    this.kembalian = parseInt(pemdis) - parseInt(this.total)
                    this.snackbar = true;
                    this.color = 'green';
                    this.text = 'Berhasil, Terimakasih';
                    this.clear = true;
                }
            },
            editHandle(item){
                this.inputType = 'add'
                this.formService.id = item.id
                this.formService.nama = item.customer.name
                this.formService.namaPet = item.pet.name
                this.formService.jenisPet = item.pet.type
                this.formService.telepon = item.customer.phoneNumber
                this.formService.cs = item.cs_name
                this.detailServices = item.service_detail

                console.log(this.detailServices)
            },
            deleteServiceDetail(deletedId){
                var uri = this.$apiUrl + 'servicetransaction/kasir/deletetransactionbyid/' + deletedId
                this.$http.delete(uri).then(response =>{ 
                    this.snackbar = true; 
                    this.text = response.data.message; 
                    this.color = 'green'
                    this.getDataLayanan(); 
                }).catch(error =>{ 
                    this.errors = error 
                    this.snackbar = true; 
                    this.text = 'Try Again'; 
                    this.color = 'red'; 
                }) 
            },
            setForm(){
                if(this.typeInput === 'add'){
                    this.setTabel();
                }
            },
            setTabel(){
                this.setTotal();
                this.e6 = 2;
            },
            deleteTabel(item,index){
                console.log(item.id)
            },
            setConfirm(){

                let serfin = {
                    id : this.formService.id,
                    total : this.total,
                    updatedBy : this.$store.getters.loggedInEmployee
                }

                this.printPDF();

                var uri =this.$apiUrl + 'servicetransaction/kasir/confirm' 
                this.$http.put(uri,this.$qs.stringify(serfin), {headers: {
                'content-type': 'application/x-www-form-urlencoded;charset=utf-8'
                }}).then(response =>{ 
                        this.snackbar = true; //mengaktifkan snackbar 
                        this.color = 'green'; //memberi warna snackbar 
                        this.text = response.data.message; //memasukkan pesan ke snackbar 
                        this.load = false; 
                        this.dialog = false;
                        this.reset();
                        this.getDataLayanan();
                        this.e6 = 1;
                    }).catch(error =>{ 
                        this.errors = error 
                        this.snackbar = true; 
                        this.text = 'Try Again'; 
                        this.color = 'red'; 
                        this.load = false; 
                    })
            },
            backService(){
                this.detailServices = []
                this.total = 0
                this.formBayar.pembayaran = 0
                this.formBayar.diskon = 0
                this.clear = false
                this.e6 = 1;
            },
            reset(){
                this.typeInput = '';
                this.detailServices = []
                this.total = 0
                this.formBayar.pembayaran = 0
                this.formBayar.diskon = 0
                this.kembalian = 0
                this.formService = {}
                this.clear = false
            },
            no(){
                for(let i = 0 ; i < this.detailServices.length ; i++)
                {
                    this.a = this.a + (i+1);
                    return this.a
                }
            },
            printPDF(){
            let i = 0;
            var doc = new jspdf("a6")
            var bulan = ['Januari','Febuari','Maret','April','Mei','Juni','Juli','Agustus','September','Oktober','November','Desember']
            var day = new Date().getDate()
            var months = new Date().getMonth()
            var month = bulan[months]
            var year = new Date().getFullYear()
            var hour = new Date().getHours()
            var minute = new Date().getUTCMinutes()
            var col = ['No','Nama Jasa Layanan','Harga','Jumlah','Sub Total'];
            var row = [];
            var id
            var nama
            var pet
            var jenis
            var telepon
            var cs
            var kasir
            var sub = this.total
            var diskon = this.formBayar.diskon
            var total = parseInt(sub) - parseInt(diskon)

            id = this.formService.id
            nama = this.formService.nama
            pet = this.formService.namaPet
            jenis = this.formService.jenisPet
            telepon = this.formService.telepon
            cs = this.formService.cs
            kasir = this.$store.getters.employeeName
            
            this.detailServices.forEach(element => {
                var temp = [this.no(), element.service.complete_name, element.service.price, 1, element.service.price]
                row.push(temp)
            });

            var width = doc.internal.pageSize.getWidth();

            //img BASE64
                var img = 'data:image/png;base64,'


            doc.addImage(img,'PNG',0,0, width, 65)

            doc.setFont("times");
            doc.setFontSize(12);
            doc.text(140,85,'Tanggal : '+day+' - '+month+' - '+year+' '+ ''+ hour + ' : ' + minute + '');
            doc.text(20,95,id);
            doc.text(20,110,'Member : '+nama+' ('+pet+' - '+jenis+') ');
            doc.text(20,115,'Telepon : '+telepon+' ');
            doc.text(145,110,'CS : '+cs+' ');
            doc.text(145,115,'Kasir : '+kasir+' ');

            // img BASE64 produk
                var img2 = 'data:image/png;base64,'

            doc.addImage(img2,'PNG',0,120,width,25)

            doc.autoTable(col,row,{startY:150, theme:'grid'});

            let y = doc.lastAutoTable.finalY;

            doc.text(150,y+10,'Sub Total : '+sub+' ')
            doc.text(150,y+15,'Diskon    : '+diskon+' ')
            doc.text(150,y+20,'TOTAL     : '+total+' ')

            doc.save('Struk Penjualan Layanan'+id+'')
        }
        },
        mounted() {
            this.getDataLayanan()
        },
    }
</script>